import React from "react";

const MissionsList = (props) => {
  return (
    <div>
      {props.error ? (
        <p>Error: {props.error}</p>
      ) : (
        <div>
          props.missions.map(mission =>{" "}
          {
            <div>
              <h2>{mission.mission_name}</h2>
            </div>
          }
          )
        </div>
      )}
    </div>
  );
};

export default MissionsList;
